const BIGGEST_WIDTH = 256;
const BIGGEST_HEIGHT = 284;

export const Box: React.FC<{
  x: number;
  y: number;
  scale: number;
  startFrame: number;
  currentFrame: number;
}> = ({ x, y, scale, currentFrame, startFrame }) => {
  const actualScale = scale * 1.5;

  const actualFrame = currentFrame - startFrame;

  if (actualFrame < 0) {
    return null;
  }

  const frame = Math.floor(actualFrame / 3);

  return (
    <AbsoluteFill
      style={{
        justifyContent: "center",
        alignItems: "center",
        justifyItems: "center",
      }}
    >
      <div
        style={{
          width: BIGGEST_WIDTH,
          height: BIGGEST_HEIGHT,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          position: "absolute",
          left: x - 112,
          top: y - 127,
          transform: `scale(${actualScale})`,
        }}
      >
        {frame === 8 ? <Sprite1></Sprite1> : null}
        {frame === 7 ? <Sprite2></Sprite2> : null}
        {frame === 6 ? <Sprite3></Sprite3> : null}
        {frame === 5 ? <Sprite4></Sprite4> : null}
        {frame === 4 ? <Sprite5></Sprite5> : null}
        {frame === 3 ? <Sprite6></Sprite6> : null}
        {frame === 2 ? <Sprite7></Sprite7> : null}
        {frame === 1 ? <Sprite8></Sprite8> : null}
      </div>
    </AbsoluteFill>
  );
};
